import React from "react";
import TrackVisibility from "react-on-screen";
import Skill from "../Items/Skill";

const skillData = {
  skillContent:
    "I can conjure up a fully formed website from nothing. I don't use tricks, and this isn't magic. I specialise in manipulating the raw materials of the web, such as HTML, CSS, JavaScript, and SVG. Linux servers serve me, domains belong to me, and certificates are specific.",
  progressData: [
    {
      id: 1,
      name: "Wordpress",
      percentage: 85,
    },
    {
      id: 2,
      name: "HTML & CSS",
      percentage: 90,
    },
    {
      id: 3,
      name: "javascript & Angular",
      percentage: 60,
    },
    {
      id: 4,
      name: "Networking",
      percentage: 90,
    },
  ],
};

function Skills() {
  return (
    <>
      <p className="mb-0">{skillData.skillContent}</p>
      <div className="mt-5">
        <div className="row -mt-50">
          {skillData.progressData.map((progress) => (
            <div className="col-md-6 mt-50" key={progress.id}>
              <TrackVisibility once>
                <Skill progress={progress} />
              </TrackVisibility>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default Skills;
